import React from 'react';
import { Container } from 'react-bootstrap';

const Dashboard: React.FC = () => {
  return (
    <Container>
      <h1>Artist Dashboard</h1>
      <p>Manage your designs and orders here</p>
    </Container>
  );
};

export default Dashboard;
